import { TxtButton } from "../../styles/Buttons";
import { LinkTextBox } from "../../styles/TextStyles";

export function chooseAmountOfProducts(
  setNumberOnSite: any,
  numberOnSite: number
) {
  function setNumber(number: number) {
    setNumberOnSite(number);
  }
  return (
    <LinkTextBox>
      <TxtButton
        onClick={() => setNumber(30)}
        theme={numberOnSite === 30 ? true : false}
      >
        30
      </TxtButton>
      |
      <TxtButton
        onClick={() => setNumber(30)}
        theme={numberOnSite === 60 ? true : false}
      >
        60
      </TxtButton>
      |
      <TxtButton
        onClick={() => setNumber(30)}
        theme={numberOnSite === 90 ? true : false}
      >
        90
      </TxtButton>
    </LinkTextBox>
  );
}
